import React, { Component } from "react";
import "./index.css";
// import Navbar from './components/NavBar';
import About from "./components/About";
import Toolkit from "./components/ToolKit";
import Projects from "./components/Projects";
import Contact from "./components/Contact";
import Footer from "./components/Footer";

import NavBar, { ElementsWrapper } from 'react-scrolling-nav';


class App extends Component {

  render() {
    const navbarItems = [{
      label: "Item 1",
      target: "item-1"
  }, {
      label: "Item 2",
      target: "item-2"
  }, {
      label: "Item 3",
      target: "item-3"
  }, {
      label: "Item 4",
      target: "item-4"
  },]
    return (
      <div>
      <NavBar items={navbarItems} offset={-80} duration={500} delay={0}>
      </NavBar>
      <div className="container">
          <ElementsWrapper items={navbarItems}>
              <div name="item-1" className="item">
                <Toolkit />
              </div>
              <div name="item-2" className="item">
                <Projects />
              </div>
              <div name="item-3" className="item">
                <Contact />
              </div>
              <div name="item-4" className="item">
                <Footer />
              </div>
          </ElementsWrapper>
      </div>
  </div>

    );
  }
}

export default App;
